import { useState, useEffect } from 'react'
import StateButton from '../components/StateButton'

function States({ states }) {

  const mappedStates = states.map((state) => {
    return <StateButton key={state.id} />
  })

  function fetchStateParks(abbr) {
    fetch(`https://developer.nps.gov/api/v1/parks?stateCode=${abbr}&limit=50&api_key=hQLUJV4Ctu79CYYc4YTuslyjKz36u5520OCQlXnF`)
    .then((r) => r.json())
    .then((stateParksData) => {
      console.log(stateParksData)
    })
  }

  return (
    <div>
      {mappedStates}
    </div>
  )
}

export default States
